For those who may not be familiar, SCL (Structured Control Language) is a programming language used for developing control logic in industrial automation systems, particularly in Siemens Simatic S7-300 and S7-400 PLCs.

To perform numerical integration using the Trapezoidal rule in SCL, I'll provide an example code snippet below. This will calculate the definite integral of a function f(x) = x^2 from a to b, with n equal subintervals.

**Note:** This implementation assumes a basic understanding of SCL programming and the Trapezoidal rule for numerical integration.

```scl

// Define the function f(x)
FUNCTION F(X: REAL): REAL :=
BEGIN 
    F := X * X; // calculate x^2 
END_FUNCTION

// Function to calculate integral using Trapezoidal rule 
FUNCTION INTEGRATE(FUNC: REFERENCE TO FUNCTION(REAL): REAL,
                   A, B, N: REAL): REAL := 
VAR 
    h: REAL;
    sum: REAL;
    i: INT;
END_VAR

BEGIN 
    // Calculate width of each subinterval (h)
    h := (B - A) / N;

    // Initialize sum to zero 
    sum := 0;

    // Apply Trapezoidal rule formula: sum(f(a) + f(b)) / 2 * h 
    FOR i FROM 1 TO N DO 
        IF i = 1 THEN 
            // first interval weight 
            sum := sum + FUNC(A); 
        ELSE IF i = N THEN 
            // last interval weight 
            sum := sum + FUNC(B);
        ELSE 
            // internal intervals weighted as 2*f(i*h) 
            sum := sum + 2 * FUNC(A + (i - 1) * h);
        END_IF;
    END_FOR;

    // multiply sum by coefficients 1/2 * h 
    sum := sum * h / 2;

    RETURN sum;
END_FUNCTION 

// Test program for integral calculation 
PROGRAM MAIN 
VAR 
    a, b: REAL := 0, 3; // integrate from a=0 to b=3 
    n: REAL := 10; // 10 equal subintervals 
    result: REAL; 
END_VAR

BEGIN 
    result := INTEGRATE(ADR(F), a, b, n);

    writeln(' Integral value:',result);  
END_PROGRAM 
```

This code defines two functions:

* `F`: computes the function f(x) = x^2.

Here's an example of how you can create a simple Flask application that greets users based on the User-Agent header in their HTTP request.

```python 
# Import the necessary libraries.
from flask import Flask, request

app = Flask(__name__)

# Route to handle GET requests to the root of the server.
@app.route('/', methods=['GET'])
def index():
    # Get the User-Agent from the request headers.
    user_agent = request.headers.get('User-Agent')

    # Extract the browser and platform information from the User-Agent string.
    if 'Chrome' in user_agent:
        browser = 'Google Chrome'
    elif 'Firefox' in user_agent:
        browser = 'Mozilla Firefox'
    else:
        browser = 'Unknown Browser'

    if 'Windows NT' in user_agent:
        platform = 'Windows'
    elif 'Mac OS X' in user_agent:
        platform ='macOS'
    elif 'Linux' in user_agent:
        platform = 'Linux'
    else:
        platform = 'Unknown Platform'

    # Return a greeting message including the browser and platform.
    return f"Hello! You're using {browser} on {platform}. Welcome to our website!"

if __name__ == '__main__':
    app.run(debug=True)
```

