In Kotlin, you can't directly access or modify a `View`'s `context` property at runtime without using reflection. However, I'll provide a workaround that uses a delegate pattern to achieve similar results.

Here's the solution:
```kotlin

inline fun <T : View> T.withContext(newContext: Context): T {
    return object : DelegateView<T>(this) {
        override fun getContext(): Context = newContext // delegate context getter to new context instance 
    }
}

// Helper class to delegate views properties and methods to original view 
class DelegateView<V : View>(private val original: V) : View by original {

    // Required overrides from View interface implementation, delegate everything except for 'context'
    override fun toString() = original.toString()
    override fun hashCode() = original.hashCode()
    override fun equals(other: Any?) = original.equals(other)
}
```
Usage example:

```kotlin

val someView: MyCustomView = LayoutInflater.from(applicationContext).inflate(R.layout.custom_view, null)

// Replace someView's context to ApplicationContext (this may be needed in multi-module projects etc.)
someView.withContext(applicationContext)

val newContextView = someView.withContext(applicationContext)

println(newContextView.context == applicationContext)  // prints true!

