**Ford-Fulkerson Algorithm Implementation**
======================================================

Below is an implementation of the Ford-Fulkerson algorithm in C++. This algorithm is used to compute the maximum flow in a flow network.

```cpp++
#include <iostream>
#include <queue>
#include <vector>

// Structure to represent an edge in the graph.
struct Edge {
    int source, sink;
    int capacity, flow;
};

class Graph {
public:
    Graph(int nodes) : numNodes(nodes), residualGraph(nodes, std::vector<Edge>(nodes)) {}

    // Add an edge to the graph with given capacity.
    void addEdge(int u, int v, int w) {
        residualGraph[u][v].capacity = w;
        residualGraph[v][u].source = v;  // Reverse edge for bidirectional flow.
    }

    // Use BFS to find augmenting path and return true if found, false otherwise.
    bool bfs(int s, int t, std::vector<int>& parent) {
        std::fill(parent.begin(), parent.end(), -1);

        std::queue<int> queue;
        queue.push(s);
        parent[s] = -2;

        while (!queue.empty()) {
            int u = queue.front();
            queue.pop();

            for (int ind = 0; ind < numNodes; ++ind) {
                if (parent[ind] == -1 && residualGraph[u][ind].flow!= residualGraph[u][ind].capacity) {
                    queue.push(ind);
                    parent[ind] = u;
                }
            }
        }

        return parent[t]!= -1;  // Check if we reached sink.
    }

