Here is a simple function that calculates the surface area and volume of a cube given its side length.

```cppcppcppc++
/**
 * Calculates the surface area and volume of a cube.
 *
 * @param sideLength The length of one side of the cube.
 * @return A pair containing the surface area and volume of the cube.
 */
#include <iostream>
using namespace std;

struct CubeProperties {
    double surfaceArea;
    double volume;
};

CubeProperties calculateCubeProperties(double sideLength) {
    if (sideLength <= 0) {
        throw runtime_error("Side length must be positive.");
    }

    // Calculate surface area (6 times square of side length)
    double surfaceArea = 6 * (sideLength * sideLength);

    // Calculate volume (cube of side length)
    double volume = sideLength * sideLength * sideLength;

    return {surfaceArea, volume};
}

int main() {
    try {
        double sideLength = 5; // replace with your value

        auto [area, volume] = calculateCubeProperties(sideLength);

        cout << "For a cube with side length " << sideLength << ":" << endl;
        cout << "Surface Area: " << area << " units^2" << endl;
        cout << "Volume: " << volume << " units^3" << endl;
    } catch (const exception& e) {
        cerr << "Error: " << e.what() << '\n';
        return 1; // Return non-zero exit code on failure.
    }

The most efficient way to sort integers up to 1000 would be to use Counting Sort.

Here's why:

1. **Counting Sort** has a time complexity of O(n + k), where n is the number of elements and k is the range of input values (in this case, 0-1000).
2. Since the range of integers is known and relatively small (0-1000), Counting Sort takes advantage of this by using an array of size 1001 (one for each possible value) to store the count of occurrences for each value.
3. Once you've counted the occurrences, constructing the sorted output is simply a matter of iterating through the count array and emitting the corresponding values.

Pseudo-code example:
```
function countingSort(arr):
    create count array C of size 1001, initialized with zeros

    // Count occurrences of each value in arr[] 
    for each x in arr[] do:
        increment C[x]

    // Construct the sorted output array D[]
    pos = 0 
    for i = 0 to 1000 do:
        while C[i] > 0:
            D[pos++] = i;
            C[i]--;

    return D[]
```
**Why it's more efficient than other sorting algorithms:**

* Quicksort and Mergesort have average-case time complexities of O(n log n), which grows faster than O(n + k) for large datasets.

